func TestGetBeatmapPacksEmpty(t *testing.T) {
	mockServer := httptest.NewServer(http.HandlerFunc(func(w http.ResponseWriter, r *http.Request) {
		if r.URL.Path != "/api/v2/beatmaps/packs" {
			http.NotFound(w, r)
			return
		}

		w.WriteHeader(http.StatusOK)
		w.Write([]byte(`{"beatmap_packs": []}`))
	}))
	defer mockServer.Close()

	client := NewClient(mockServer.URL)

	packs, err := client.GetBeatmapPacks()
	if err != nil {
		t.Fatalf("GetBeatmapPacks() failed: %v", err)
	}

	if len(*packs) != 0 {
		t.Errorf("unexpected amount of elements: expected %d, got %d", 0, len(*packs))
	}
}

